using System;
using System.IO;
using System.Media;
using System.Threading;
using System.Windows.Forms;

namespace prjICS
{
    public partial class EndScreen : Form
    {
        SoundPlayer player = new SoundPlayer(Properties.Resources.The_End___MLBIS);//Initialize the music player

        void textScroll(int milliseconds, string text, Label label)
        {
            label.Text = "";
            for (int x = 0; x < text.Length; x++)
            {
                String character = text.Substring(x, 1);
                label.Text += character;
                Thread.Sleep(milliseconds);
                label.Update();
            }
        }

        void saveMarks()
        {
            //Output the scores to a text file.
            StreamWriter file = new StreamWriter("marks.txt");
            for (int x = 0; x < HelpMenu.marks.Length; x++)
            {
                file.WriteLine(HelpMenu.marks[x]);
            }
            file.Close();
        }

        void saveNames()
        {
            //Output the scores to a text file.
            StreamWriter file = new StreamWriter("names.txt");
            for (int x = 0; x < HelpMenu.names.Length; x++)
            {
                file.WriteLine(HelpMenu.names[x]);
            }
            file.Close();
        }

        public EndScreen()
        {
            InitializeComponent();
        }

        private void EndScreen_Shown(object sender, EventArgs e)
        {
            player.PlayLooping();
            saveMarks();//Save the user's score
            saveNames();//Save the suer's name
